import Container from 'react-bootstrap/Container'

function App() {
  return (
    <div className="App">
     <Header str = "Login"></Header>
      <Container className = "border p-4">
        <Inputfield ueberschrift = "E-mail" type = "email" id = "email"></Inputfield>
        <Inputfield ueberschrift = "E-mail" type = "email" id = "Userpasswort"></Inputfield>
      </Container>
    </div>
  );
}

export default App;
